ISLAMABAD, Dec 28 (APP): Syed Abdul Qadir Gillani, a former member of the National Assembly and son of former prime minister Syed Yousaf Raza Gillani, on Wednesday called on Prime Minister Muhammad Shehbaz Sharif.
During the meeting, the current political situation of the country and other issues of mutual interests were discussed, PM Office Media Wing said in a press release.
